type TelemetryDataRow = (boolean | number)[];

export function telemetryArrayToObject(rows: TelemetryDataRow[]): TelemetryRow[] {
  return rows.map((row) => {
    return row.reduce((acc, value, index) => ({
      ...acc,
      [headers[index]]: value,
    }), {} as TelemetryRow);
  });
}

